import Expenses from "./components/Expenses";

const expenses = [
  {
    id: "p1",
    title: "Hoody",
    amount: 500,
    date: new Date(2022, 1, 14),
  },
  {
    id: "p2",
    title: "Socks",
    amount: 120,
    date: new Date(2022, 2, 12),
  },
  {
    id: "p3",
    title: "Black T's",
    amount: 250,
    date: new Date(2022, 2, 28),
  },
  {
    id: "p4",
    title: "Cap",
    amount: 200,
    date: new Date(2022, 5, 12),
  },
];
function App() {
  return (
    <div>
      <h2>Foxy Dexx </h2>
      <Expenses />
    </div>
  );
}

export default App;
